import "./NavLogo.scss";
import Logo from "../../../assets/images/rae-chastain-logo.png";

const NavLogo = () => {
    return (
        <img className="nav__logo" src={Logo} alt="rae chastain's logo" />
    );
};

export default NavLogo;
